import React,{Component} from 'react';
import TopNavLeftIcons from 'TopNavLeftIcons';
import TopNavRightIcons from 'TopNavRightIcons';

class TopNav extends Component {
     
    render() {
        return (
            <div>
                <TopNavLeftIcons />
                <TopNavRightIcons />
            </div>
        )
    };
}
export default TopNav;
